import React from 'react';
import { Button } from 'antd';


const Buttons = () => {
  return (
    <>
      <Button type="primary" shape="round" style={{width: '500px', marginTop: '50px', height: '100px', backgroundColor:'#C7C6FF', borderColor: '#0054FF'}}></Button>
    </>
  )
}


export default Buttons;
